import React from 'react';
import './App.css';

function handleClick(e) {
  e.preventDefault();
  console.log('The link was clicked.');
}

function App() {
  return (

<div className="App">
<header>
 <a href="#" onClick={handleClick}></a>

<h1> Functions</h1>
</header>

</div>
);
}

export default App;
